import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Nav from "./Nav";
import Banner from "./Banner";
import BannerData , {BannerBox , TwoSecData} from "./Data";
import twoSec from "./TwoSec";


function Two(value){
    return(
        <TwoSec Sorce={value.Sorce}
        h2={value.h2}
        para={value.para} />
    )
}
ReactDOM.render(
    <>
        <div className="header">
            <Nav/>

           <Banner/>

        </div>
        <div className="twoSec">
             {TwoSecData.map(Two)}
        </div>
    </>,document.getElementById("root")
);
